    uUWI: function(e, t) {
        e.exports = '  <nav class="navbar navbar-default">\n    <div class="container">\n      <div class="navbar-header">\n        <button type="button" class="navbar-toggle" data-toggle="collapse" data-target="#myNavbar">\n          <span class="icon-bar"></span>\n          <span class="icon-bar"></span>\n          <span class="icon-bar"></span>                        \n        </button>\n        <a class="navbar-brand" href="./">Sala De Juegos</a>\n      </div>\n      <div class="collapse navbar-collapse" id="myNavbar">\n        <ul class="nav navbar-nav navbar-right">\n          <li><a href="./quien-soy#quien">Quien</a></li>\n          <li><a href="./quien-soy#juego">Juego</a></li>\n          <li><a href="./quien-soy#que">Que es</a></li>\n          <li><a href="./quien-soy#donde">Donde</a></li>\n        </ul>\n      </div>\n    </div>\n  </nav>\n  \n  \x3c!-- First Container --\x3e\n  <div id ="quien"class="container-fluid bg-1 text-center">\n    <h3 class="margin">Qui\xe9n Soy?</h3>\n    <img src="./assets/imagenes/quiensoy.jpg" class="img-responsive img-circle margin" style="display:inline" alt="Bird" width="350" height="350">\n    <h3>Leandro M. Arnoso</h3>\n    <h3>Soy un alumno de la Tecnicatura en Programaci\xf3n de la UTN FRA</h3>\n  </div>\n\n  \x3c!-- Second Container --\x3e\n  <div id ="juego"class="container-fluid bg-2 text-center">\n    <h3 class="margin">El juego: Arhocado</h3>\n    <p>El ahorcado es un juego de adivinanzas. Usando una fila de guiones, se representa la palabra a adivinar, dando el n\xfamero de letras. Si el jugador sugiere una letra que aparece en la palabra, se escribe en todas sus posiciones correctas. Si la letra sugerido no ocurre en la palabra, se agrega un parte del cuerpo de la figura de hombre colgado como una marca de conteo. El juego termina cuando:</p>\n      <ul><li>El jugador completa la palabra.</li>\n      <li>Se compleate la figura.</li></ul>\n    \n    <a href="/juegos/ahorcado" class="btn btn-success btn-lg">\n      <span class="glyphicon glyphicon-game"></span> Ir al Juego\n    </a>\n  </div>\n  \n  \x3c!-- Third Container --\x3e\n  <div id ="que" class="container-fluid bg-3 text-center">\n    <h3 class="margin">Esto es un trabajo pr\xe1ctico</h3>\n    <p>Cada universidad, cada facultad, cada carrera y obviamente cada materia en particular tiene estrategias did\xe1cticas y formas de evaluaci\xf3n diferentes. A pesar de que en muchos casos las universidades intentan estandarizar la forma de dictar clase para generar un orden en las planificaciones cuatrimestre a cuatrimestre, las formas de evaluaci\xf3n son elementales tanto para las instituciones y profesores como para los alumnos. A trav\xe9s de la evaluaci\xf3n formativa el educador busca informaci\xf3n en el alumno para lograr comprender c\xf3mo se est\xe1\n      produciendo el proceso de aprendizaje y poder reajustar los objetivos pedag\xf3gicos. Y para el alumno es una muestra del progreso que est\xe1 logrando y si puede aplicar, materializar y darle visibilidad a la comprensi\xf3n del tema. Seg\xfan Black y William (1998), la evaluaci\xf3n formativa, ayuda a que los estudiantes sean independientes a la hora del aprendizaje, es decir, se presenta como receptor, autorregulador y centro de esa misma evaluaci\xf3n. </p>\n    <a href="#" class="btn btn-default btn-lg">\n      <span class="glyphicon glyphicon-file"></span> Descargar PDF\n    </a>\n  </div>\n  \n  \x3c!-- Fourth Container (Grid) --\x3e\n  <div id ="donde" class="container-fluid bg-4 text-center">    \n    <h3 class="margin">D\xf3nde Funciona?</h3><br>\n    <div class="row">\n      <div class="col-sm-4">\n        <p>Con las tecnologias WEB que permiten desarrollar aplicaciones multiplataforma</p>\n        <img src="./assets/imagenes/quiensoy1.png" class="img-responsive margin imagenDeQuienSoy"  alt="Image">\n      </div>\n      <div class="col-sm-4"> \n        <p>Principalmente orientada a la experiencia del usuario, garantizando que su funcionamieto sea fluido y pensado en el comportamiento del usuario y en la funcionalidad.</p>\n        <img src="./assets/imagenes/quiensoy2.jpg" class="img-responsive margin imagenDeQuienSoy" alt="Image">\n      </div>\n      <div class="col-sm-4"> \n        <p>Para los sistemas operativos lideres en el mercado del consumo masivo</p>\n        <img src="./assets/imagenes/quiensoy3.png" class="img-responsive margin imagenDeQuienSoy" alt="Image">\n      </div>\n    </div>\n  </div>\n  \n  \x3c!-- Footer --\x3e\n  <footer class="container-fluid bg-5 text-center">\n    <p>Modificado por <a href="https://www.octavio.com.ar">www.octavio.com.ar</a></p> \n  </footer>'
    },
